//Componente


export const App = () => {
    return (
    <Fragment> 
    <h1>Hello World</h1>
    <p> Aprendamos React</p>
    <button onClick={Activar}>Activar botón</button>
    </Fragment> 
    );
}

function Activar(){
    alert("El botón ha sido activado")
}
